/* Procedure structure for procedure `basicos` */

/*!50003 DROP PROCEDURE IF EXISTS  `basicos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `basicos`(empleado int, empresa int)
BEGIN
  DECLARE done INT DEFAULT 0;
  DECLARE cve varchar(16);
  DECLARE cur1 CURSOR FOR select clave from cat_conceptos where afectacion = 'G';
  DECLARE CONTINUE HANDLER FOR SQLSTATE '04000' SET done = 1;
  OPEN cur1;
  REPEAT
    FETCH cur1 INTO cve;
    IF cve = '101' THEN
    
        SET @sueldobase = 0;
        SELECT sueldobase into @sueldobase from nominaemp where idnominaemp = empleado;
        insert into nomina(idnominaemp, concepto, importe, tipo, idempresa)
        values(empleado, '101', @sueldobase, 'P', empresa);
  
    END IF;
    
    IF cve = '251' THEN 
    
        SET @resul = 0;
        SET @linferior = 0;
        SET @cuotafija = 0;
        SET @porciento = 0;
        SET @sueldobase = 0;
        
        SELECT sueldobase into @sueldobase from nominaemp where idnominaemp = empleado;
        
        SET @sueldobase := @sueldobase * 2;
        
        select limiteinferior, cuotafija, porciento into @linferior, @cuotafija, @porciento
        from isr 
        where (@sueldobase between limiteinferior and limitesuperior) or (@sueldobase >= limiteinferior and limitesuperior=0);
        
        SET @resul := ((@sueldobase - @linferior) * (@porciento/100)) + @cuotafija;
        
        SET @resul := @resul / 2;
        
        insert into nomina(idnominaemp, concepto, importe, tipo, idempresa)
        values(empleado, '251', @resul, 'D', empresa);
        
    END IF;
    
    IF cve = '274' THEN
    
        insert into nomina(idnominaemp, concepto, importe, tipo, idempresa)
        values(empleado, '274', 15.12, 'D', empresa);
    
    END IF;
    UNTIL done END REPEAT;
  CLOSE cur1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `calculaimporte` */

/*!50003 DROP PROCEDURE IF EXISTS  `calculaimporte` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `calculaimporte`(idempleado int, cve_concepto varchar(4))
BEGIN
    if cve_concepto = '101' then /* sueldo base */
        set @sueldo = 0;
        select sueldobase as importe from cat_categoria where clave = cve_concepto;
    end if;
    if cve_concepto = '251' then /* isr */
    
        set @resul = 0;
        set @linferior = 0;
        set @cuotafija = 0;
        set @porciento = 0;
        set @sueldobase = 0;
        
        select sueldobase into @sueldobase from nominaemp where idnominaemp = idempleado;
        
        set @sueldobase := @sueldobase * 2;
        
        select limiteinferior, cuotafija, porciento into @linferior, @cuotafija, @porciento
        from isr 
        where (@sueldobase between limiteinferior and limitesuperior) or (@sueldobase >= limiteinferior and limitesuperior=0);
        
        set @resul := ((@sueldobase - @linferior) * (@porciento/100)) + @cuotafija;
        
        set @resul := @resul / 2;
        
        select cast(@resul as decimal(10,2)) as importe;
        
    end if;
    
    if cve_concepto = '274' then /* imss */
    
        select 15.12 as importe;
    
    end if;
    
END */$$
DELIMITER ;

/* Procedure structure for procedure `calcula_imss` */

/*!50003 DROP PROCEDURE IF EXISTS  `calcula_imss` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `calcula_imss`(IN empleado INT,In Q INT, OUT resul INT)
BEGIN
		SET @SDI = 0;
			SELECT ROUND((
				((SUM(importe)*2)/30) +
				((((SUM(importe)*2)/30)*40)/365) +
				(((((SUM(importe)*2)/30)*20)*0.25)/365)),4) INTO @SDI
			FROM nomina WHERE idnominaemp = empleado AND tipo = 'P' AND (concepto = 101 OR concepto = 114); /*Obtiene Salario Diario Integrado asignando a la variable @SDI*/
			
			SELECT 	ROUND( ( ((@SDI-((SELECT importe  FROM salmin)*3))*(excedente/100)) +  
				(@SDI*(cuotadinero/100)) +  
				(@SDI*(cuotaespecie/100)) +  
				(@SDI*(invalidezyvida/100)) +  
				(@SDI*(cesantiayvejez/100))) *
				(SELECT DATEDIFF(fhasta,fdesde) + 1  FROM cat_quincenas
					WHERE quincena = Q AND anio = YEAR(NOW())) ,2) 
				AS total
			 FROM imss; /*Devuelve la Cuota que le toca al trabajador*/
	END */$$
DELIMITER ;

